import React, {useEffect, useState} from 'react';

import './App.css';

type AppType = {
  id:string
  title:string
  body:string;
}

function App() {

  let [state,setState]=useState<AppType[]>([])
  useEffect(()=>{fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then(json => setState(json))},[state])
  return (
    <div className="App">
      <ul>
        {state.map((el)=>{
          return(
              <li>{el.body}</li>
          )
        })}

      </ul>
    </div>
  );
}

export default App;
